response.activities:
ПРАКТИЧЕСКИЙ ПСИХОЛОГ КОНСУЛЬТАНТ, Позитивная психология, детская психология, психология стресса.Я помогу вам, если у вас есть затруднения в следующих направлениях:
- Самооценка и уверенность в себе;
- Отношения с противоположным полом;
- Достижение целей;
- Отношения в семье;
- Внутренние конфликты;
- Отношения с окружающими людьми;
- Сложности адаптации в новых условиях;
 АСТРОЛОГ- ИССЛЕДОВАТЕЛЬ.  Направление:  НАУЧНАЯ АСТРОЛОГИЯ (закончила Санкт-Петербургскую Астрологическую Академию). Консультирую по вопросам: брачные отношения, вопросы совместимости (в том числе и бизнес-партнеров), профориентация, разбор конкретных ситуаций (личная жизнь и ее перспективы, проблемы здоровья, подбор даты для операции, покупка / продажа недвижимости (стоит / не стоит и когда), устройство / увольнение с работы (когда лучше), переезды (подбор места жительства с определенной целью) с подробным прогнозом на год, выбор времени для создания фирмы с заданными свойствами, анализ финансовой устойчивости фирмы, выбор времени для крупных покупок, анализ потенциала детского гороскопа и др.
